import React,{Component} from 'react';
import Link from 'next/link';

class Home extends Component{
  constructor(props){
    super(props)
  }
  render(){
    return(
      <>
        <div>
          <nav>
             <Link href="/">Home</Link>-
             <Link href="/contact">Contact</Link>-
             <Link href="/about">About</Link>-
             <Link href="/users">Users</Link>
          </nav>
        </div>
        <h1>welcome to homepage</h1>
      </>
    )
  }
}

export default Home
